// SPDX-License-Identifier: MIT

pragma solidity ^0.8.0;

import "openzeppelin-solidity/contracts/access/Ownable.sol";
import "openzeppelin-solidity/contracts/utils/Strings.sol";
import "./IFactoryERC721.sol";
import "./OGFlat.sol";

contract OGFlatFactory is FactoryERC721, Ownable {
    using Strings for string;

    event Transfer(
        address indexed from,
        address indexed to,
        uint256 indexed tokenId
    );

    address public proxyRegistryAddress;
    address public nftAddress;
    address public lootBoxNftAddress;
    address public constant foundationAddress = 0x658A13938775f901bd02596c6ca794E25f8C50F5;
    string public baseURI = "http://52.221.64.228:5000/api/factory/";

    // Maximum supply
    uint256 FLAT_SUPPLY = 50;

    /*
     * Three different options for minting Creatures (basic, premium, and gold).
     */
    uint256 NUM_OPTIONS = 3;
    uint256 SINGLE_CREATURE_OPTION = 0;
    uint256 MULTIPLE_CREATURE_OPTION = 1;
    uint256 LOOTBOX_OPTION = 2;
    uint256 NUM_CREATURES_IN_MULTIPLE_CREATURE_OPTION = 4;

    constructor(address _proxyRegistryAddress, address _nftAddress) {
        proxyRegistryAddress = _proxyRegistryAddress;
        nftAddress = _nftAddress;

        fireTransferEvents(address(0), owner());
    }

    function name() override external pure returns (string memory) {
        // return "osOgFlats Item Sale";
        return "Swiddle Factory";
    }

    function symbol() override external pure returns (string memory) {
        // return "CPF";
        return "SWF";
    }

    // function totalSupply() external view returns (uint256) {
    //     return FLAT_SUPPLY;
    // }

    function supportsFactoryInterface() override public pure returns (bool) {
        return true;
    }

    function numOptions() override public view returns (uint256) {
        return NUM_OPTIONS;
    }

    function transferOwnership(address newOwner) override public onlyOwner {
        address _prevOwner = owner();
        super.transferOwnership(newOwner);
        fireTransferEvents(_prevOwner, newOwner);
    }

    function fireTransferEvents(address _from, address _to) private {
        for (uint256 i = 0; i < NUM_OPTIONS; i++) {
            emit Transfer(_from, _to, i);
        }
    }

    function sendToFoundation(uint256 etherValue) private {
        payable(foundationAddress).transfer(etherValue);
    }


    function mint(uint256 _optionId, address _toAddress) override public payable {
        // Must be sent from the owner proxy or owner.
        ProxyRegistry proxyRegistry = ProxyRegistry(proxyRegistryAddress);
        assert(
            address(proxyRegistry.proxies(owner())) == _msgSender() ||
                owner() == _msgSender()
        );

        require(msg.value >= 0.175 ether, "0.175 eth is required to mint");
        //Counts how many flats can be purchased with eth amount 
        uint256 mintCount = msg.value / 0.175 ether;
        require(canMint(mintCount), "Max supply reached");

        sendToFoundation(msg.value);

        OGFlat osOgFlats = OGFlat(nftAddress);
        for (uint256 i = 0; i < mintCount; i++) {
            osOgFlats.mintTo(_toAddress);
        }
    }  

    function canMint(uint256 mintCount) public view returns (bool) {
        OGFlat osOgFlats = OGFlat(nftAddress);
        uint256 creatureSupply = osOgFlats.totalSupply();

        return creatureSupply < (FLAT_SUPPLY - mintCount);
    }

    function tokenURI(uint256 _optionId) override external view returns (string memory) {
        return string(abi.encodePacked(baseURI, Strings.toString(_optionId)));
    }

    /**
     * Hack to get things to work automatically on OpenSea.
     * Use transferFrom so the frontend doesn't have to worry about different method names.
     */
    function transferFrom(
        address _from,
        address _to,
        uint256 _tokenId
    ) public {
        mint(_tokenId, _to);
    }


    // function royaltyInfo(uint256 _tokenId, uint256 _salePrice) external view returns (
    //     address receiver,
    //     uint256 royaltyAmount
    // ){
    //     OGFlat osOgFlats = OGFlat(nftAddress);
    //     uint256 royaltyAmount = _salePrice * 25/1000;
    //     return (address(this), royaltyAmount);
    // }


    /**
     * Hack to get things to work automatically on OpenSea.
     * Use isApprovedForAll so the frontend doesn't have to worry about different method names.
     */
    function isApprovedForAll(address _owner, address _operator)
        public
        view
        returns (bool)
    {
        if (owner() == _owner && _owner == _operator) {
            return true;
        }

        ProxyRegistry proxyRegistry = ProxyRegistry(proxyRegistryAddress);
        if (
            owner() == _owner &&
            address(proxyRegistry.proxies(_owner)) == _operator
        ) {
            return true;
        }

        return false;
    }


    /**
     * Hack to get things to work automatically on OpenSea.
     * Use isApprovedForAll so the frontend doesn't have to worry about different method names.
     */
    function ownerOf(uint256 _tokenId) public view returns (address _owner) {
        return owner();
    }
}
